import styled from 'styled-components'

export const Container = styled.div`
  flex: 1;
  align-items: center;
  justify-content: center;
  background-color: #F5F5F5;
`;

export const Logo = styled.img`
  height: 30%;
  margin-bottom: 40px;
`;

export const Input = styled.input`
  padding: 15px 20px;
  border-radius: 5px;
  background-color: #FFF;
  align-self: stretch;
  margin-bottom: 15px;
  margin: 0px 20px;
  font-size: 16px;
`;

export const ErrorMessage = styled.label`
  text-align: center;
  color: #ce2029;
  font-size: 16px;
  margin-bottom: 15px;
  margin: 0px 20px;
`;

export const Button = styled.TouchableHighlight`
  padding: 20px;
  border-radius: 5px;
  background-color: #FC6663;
  align-self: stretch;
  margin: 15px;
  margin: 0px 20px;
`;

export const ButtonText = styled.Text`
  color: #FFF;
  font-weight: bold;
  font-size: 16px;
  text-align: center;
`;

export const SignUpLink = styled.TouchableHighlight`
  padding: 10px;
  margin-top: 20px;
`;

export const SignUpLinkText = styled.Text`
  color: #999;
  font-weight: bold;
  font-size: 16px;
  text-align: center;
`;
